            return new Vente(this.tontine.id,this.tontine.actif,this.tontine.nom,this.tontine.type,this.tontine.tauxTontine,this.tontine.tauxEchec,this.tontine.tauxRetard,this.tontine.frequence,this.tontine.createdAt,this.tontine.updatedAt,this.tontine.nbSeances,this.tontine.tauxEchecB);
